import React, { useContext } from "react";
import { Title, LoginTextField, LoginButton } from "./Materials";
import GoogleLogin from "react-google-login";
import { useHistory } from "react-router-dom";
import UserProfile from "../../contexts/UserProfile";

const Home = () => {
  const history = useHistory();
  const [profile, setProfile] = useContext(UserProfile);

  function success(response) {
    history.push("/email");
    setProfile(response.profileObj)
    console.log(response.profileObj);
  }

  function failure(response){
    console.log(response);
  }

  return (
    <div class="h-full">
      <form
        class="h-full flex flex-wrap content-center justify-center flex-col"
        noValidate
        autoComplete="off"
      >
        <div class="text-center mb-6">
          <Title variant="h2" colorPrimary="white">
            AutoSend
          </Title>
        </div>

        <GoogleLogin
          clientId="326577504864-i1i21jgf39623ij98hmhhblpig513hto.apps.googleusercontent.com"
          buttonText="Login with Google"
          theme="dark"
          onSuccess={success}
          onFailure={failure}
          cookiePolicy={'single_host_origin'}
        />

      </form>
    </div>
  );
};

export default Home;
